"use strict";function duplicate(n){var t=$("#"+n+" ul");t.find("li:last").clone(!0).appendTo(t)}function detectLength(n,t){var r=$(n).length,u=$(n).outerWidth()+t,i=r*u;console.log("litotalWidth: "+i);$(n).parent("ul").css("width",i)}$(document).ready(function(){for(i=0;i<5;i++)duplicate("product-make");for(i=0;i<3;i++)duplicate("product-make2");for(i=0;i<155;i++)duplicate("slider-bar");$(function(){detectLength($("#slider1 li"),0);detectLength($("#slider2 li"),0);detectLength($("#slider3 li"),0)})});